window.bookSummaryJSON = "<p>Missy has returned to West Point, only to find she must once again rush off to help her buddies at Paranormal Branch. This time, her friend Tracy goes along. One thing leads to another and soon the girls are dealing with international crime organizations and terrorists. They also, of course, must then explain a few things to their boyfriends!</p> <p>Missy and Tracy certainly have many friends in high places at the US Government, but those friends are finding it harder and harder to keep all the supernatural activities by these girls a secret. And, will any of Missy's adventures affect her career at West Point?</p>"; 
